import React, { useState } from "react";
import useStyles from "./styles.js";
import moment from "moment";
import {
  Card,
  CardActions,
  CardMedia,
  CardContent,
  Button,
  Typography,
} from "@mui/material";
import ThumbUpAltIcon from "@mui/icons-material/ThumbUpAlt";
import DeleteIcon from "@mui/icons-material/Delete";
import MoreHorizIcon from "@mui/icons-material/MoreHoriz";
import { useDispatch } from "react-redux";
import { increaseLike } from "../../../actions/posts.js";

const Post = ({ post, setCurrentId, currentId }) => {
  const classes = useStyles();
  const dispatch = useDispatch();
  const handleLike = () => {
    setCurrentId(post._id);
    dispatch(increaseLike(currentId, post));
    console.log("update", currentId);
  };

  return (
    <Card className={classes.card}>
      <CardMedia
        className={classes.media}
        image="data:image/jpeg;base64,"
        title={post?.title}
      />
      <div className={classes.overlay}>
        <Typography variant="h6">{post?.creator}</Typography>
        <Typography variant="body2">
          {moment(post?.createdAt).fromNow()}
        </Typography>
      </div>
      <div className={classes.overlay2}>
        <Button
          style={{ color: "white" }}
          size="small"
          onClick={() => setCurrentId(post?._id)}
        >
          <MoreHorizIcon size="large" />
        </Button>
      </div>
      <div className={classes.details}>
        <Typography variant="body2" color="textSecondary">
          {post?.tags?.map((tag) => tag)}
        </Typography>
      </div>
      <CardContent>
        <Typography className={classes.title} variant="h5" gutterBottom>
          {post?.message}
        </Typography>
      </CardContent>
      <CardActions className={classes.cardActions}>
        <Button size="small" color="primary" onClick={handleLike}>
          <ThumbUpAltIcon fontSize="small" /> Like {post?.likeCount}
        </Button>
        <Button size="large" color="primary" onClick={() => {}}>
          <DeleteIcon /> Delete
        </Button>
      </CardActions>
    </Card>
  );
};

export default Post;
